    /**
     * Retorna a chave da faixa etária correta para o BPA-2.
     * @param {number} age - A idade do paciente em anos.
     * @returns {string|null} A chave da faixa etária ou nulo.
     */
    getAgeGroupKeyBPA2: function(age) {
        if (age >= 6 && age <= 14) return age.toString();
        if (age >= 15 && age <= 17) return '15-17';
        if (age >= 18 && age <= 20) return '18-20';
        if (age >= 21 && age <= 30) return '21-30';
        if (age >= 31 && age <= 40) return '31-40';
        if (age >= 41 && age <= 50) return '41-50';
        if (age >= 51 && age <= 60) return '51-60';
        if (age >= 61 && age <= 70) return '61-70';
        if (age >= 71 && age <= 80) return '71-80';
        if (age >= 81) return '81+';
        return null;
    },

    /**
     * Calcula a pontuação média para um subteste do BPA-2 com base na faixa etária.
     * @param {string} ageGroupKey - A chave da faixa etária.
     * @param {string} subtest - A chave do subteste ('ac', 'ad', 'aa', 'ag').
     * @returns {number|null} A pontuação média ou nulo.
     */
    getBpa2AverageScore: function(ageGroupKey, subtest) {
        const baremTable = this.BPA2Data[subtest]?.[ageGroupKey];
        if (!baremTable) return null;
        
        const medianRange = baremTable.find(range => range.percentile === 50);
        if (medianRange?.score) {
            const minScore = medianRange.score[0] <= -1000 ? medianRange.score[1] : medianRange.score[0];
            const maxScore = medianRange.score[1] >= 1000 ? medianRange.score[0] : medianRange.score[1];
            return Math.round((minScore + maxScore) / 2);
        }
        return null;
    },

    /**
     * Busca a classificação e o percentil para uma única pontuação do BPA-2.
     * @param {string} ageGroupKey - A chave da faixa etária (ex: '7', '18-20').
     * @param {string} subtest - A chave do subteste (ex: 'ac', 'ad').
     * @param {number|string} score - A pontuação bruta obtida.
     * @returns {object} Um objeto com as chaves 'percentile' e 'classification'.
     */
    getBpa2Classification: function(ageGroupKey, subtest, score) {
        const result = { percentile: '-', classification: 'Inválido' };
        const scoreNum = parseInt(score, 10);

        if (isNaN(scoreNum)) {
            return { percentile: '-', classification: '-' };
        }

        const baremTable = this.BPA2Data[subtest]?.[ageGroupKey];
        if (!baremTable) {
            result.classification = 'Baremo não encontrado';
            return result;
        }

        const foundRange = baremTable.find(range => scoreNum >= range.score[0] && scoreNum <= range.score[1]);
        if (foundRange) {
            result.percentile = foundRange.percentile;
            result.classification = foundRange.classification;
        } else {
            result.classification = 'Pontuação fora da faixa';
        }

        return result;
    }
